import React from "react";

interface InputProps {
    data: string[];
    all: boolean;
    active: boolean;
    completed: boolean;
}

const List: React.FC<InputProps> = ({ data, all, active, completed }) => {
    return (
        <div>
            {data.map((item, i) => (
                <div key={i} >
                    {all && (
                        <div>
                            <input type="checkbox" />
                            <span>{item}</span>
                            <button>X</button>
                        </div>
                    )}
                    {active && (
                        <div>
                            <input type="checkbox" />
                            <span>{item}</span>
                            <button>X</button>
                        </div>
                    )}
                    {completed && (
                        <div>
                            <input type="checkbox" />
                            <span></span>
                            <button>X</button>
                        </div>
                    )}
                </div>
            ))}
        </div>
    );
}

export default List;
